import React from 'react';
import {AppBar , Typography} from '@mui/material';

const Header = () => {
  return (
    <AppBar>
        <Toolbar>
            <Typography>BLogsApp</Typography>
        </Toolbar>
    </AppBar>
  )
}

export default Header
